import React, { Component } from "react";
import { Breadcrumb, Icon, Row, Col, Layout, Card, Carousel, Input, Button, Divider } from "antd";
import { fetchProfiles } from "../../redux/actions/dashboardAction";
import { connect } from "react-redux";
// import "../../static/css/style.scss";
class Dashboard extends Component {
  componentDidMount() {
    this.props.fetchProfiles();
  }
  render() {
    console.log("YOUR REDUCER DATA IS.....", this.props.data);
    return (
      <Layout>
        <Row>
          <Col span={8} md={8} xs={24}>
            Dashboard
          </Col>
          <Col span={12} md={12} xs={24}>
            <Row>{this.props.data ? <p>Data Hai</p> : <p>Data Nahi hai</p>}</Row>
          </Col>
          <Col span={4} md={4} xs={24}>
            Dashboard
          </Col>
        </Row>
      </Layout>
    );
  }
}
const mapStateToProps = state => {
  return {
    data: state.profiles
  };
};
function mapDispatchToProps(dispatch) {
  return {
    fetchProfiles: data => {
      dispatch(fetchProfiles(data));
    }
  };
}
export default connect(mapStateToProps, mapDispatchToProps)(Dashboard);
